import React from "react"

let contactData = [
    {
        "department":'Computer Science and Engineering',
        "hod": 'Meena S M',
        "hodEmail": 'msm@kletech.ac.in',
        "hodPNumber": '123456789',
        "officeIncharge": 'Shivanand Chandargi',
        "officeEmail":'cse@kletech.ac.in',
        "officeNumber":'9999999999'
    }
]

function Contact() {

    onst [newData, setData] = useState("");
    const getData = () =>{
      // add url here
      axios.get('http://192.168.137.1:8000') 
      .then(res => {
          console.log('Data fetcted from backend!')
          setData(res.data)
          console.log(res.data)
      }).catch(err => {
          console.log(err)
      })
  }


    return <div className="content">
        <div className="mx-[9.5rem] my-16">
            <div className="my-7 bg-zinc-200 rounded-lg p-5">
                <h1 className="font-bold text-3xl my-3">{contactData.department}</h1>
                <p className="text-xl leading-8">
                    HOD - {contactData.hod}
                    <ul>
                        <li>Email - {contactData.hodEmail}</li>
                        <li>Phone - {contactData.hodNumber}</li>
                    </ul>
                </p>
                <p className="text-xl leading-8">
                    Office Incharge - {contactData.officeIncharge}
                    <ul>
                        <li>Email - {contactData.officeEmail}</li>
                        <li>Phone - {contactData.officeNumber}</li>
                    </ul>
                </p>
            </div>
        </div>
    </div>
}

export default Contact;


